package day30.programtask;

public class mulFloatNum {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		System.out.println("Multiplication of two floating number : "+multFloatNumber(10.1f,8.2f));
	}
	static double multFloatNumber(float num1,float num2)
	{
		double mult=num1*num2;
		return mult;
	}

}
